import React from 'react';

// Liste de vos projets
const projectList = [
  {
    title: "Jeu Morpion IA Imbattable",
    description: "Une IA qui ne perd jamais au morpion, utilisant un algorithme basé sur le Minimax.",
    link: "https://github.com/votre_compte/Jeu_Morpion_IA_Imbattable",
  },
  {
    title: "Jeu d'échecs IA Alpha-Beta",
    description: "Un jeu complet d'échecs pour s'entraîner avec une IA modulable en niveau.",
    link: "https://github.com/votre_compte/Jeu_echecs_IA_alpha_beta",
  },
  {
    title: "Classification Pokémon avec CNN",
    description: "Reconnaît les 151 Pokémons avec un réseau de neurones convolutifs.",
    link: "https://github.com/votre_compte/Classification_Pokemons_CNN_python",
  },
  {
    title: "Analyse permis construire historique législations",
    description: "Analyse de l'évolution des permis de construire en fonction des législations passées.",
    link: "https://github.com/Fyoken/Analyse_permis_construire_historique_legislations",
  },
  {
    title: "Chatbot LLM embarqué",
    description: "Développement d'un chatbot intelligent avec un modèle de langage embarqué dans un environnement mobile.",
    link: "https://github.com/Fyoken/Chatbot_LLM_embarque",
  },
  {
    title: "MeetingDisplay",
    description: "Application pour afficher les horaires et les informations des salles de réunion dans une organisation.",
    link: "https://github.com/Fyoken/MeetingDisplay",
  },
  {
    title: "Impact PM2.5 aéroports",
    description: "Analyse de l'impact de la pollution de l'air (PM2.5) autour des aéroports avec des données en temps réel.",
    link: "https://github.com/Fyoken/Impact_PM2.5_aeroports_python",
  },
  {
    title: "Segmentation rétines CNN",
    description: "Utilisation des réseaux neuronaux convolutifs pour la segmentation d'images de rétines.",
    link: "https://github.com/Fyoken/Segmentation_retines_CNN",
  },
  {
    title: "Chatbot recommandation films",
    description: "Un chatbot qui recommande des films en fonction des préférences de l'utilisateur.",
    link: "https://github.com/Fyoken/Chatbot_recommandation_films_python",
  },
  {
    title: "Clustering e-commerce",
    description: "Application de techniques de clustering pour analyser les comportements des clients dans un site de e-commerce.",
    link: "https://github.com/Fyoken/Clustering_e-commerce_R",
  },
  {
    title: "Bat algorithm multi-objective optimization",
    description: "Optimisation multi-objectifs à l'aide de l'algorithme de chauve-souris.",
    link: "https://github.com/Fyoken/Bat_algorithm_multi_objective_optimization",
  },
  {
    title: "Site jeu de Piste",
    description: "Un jeu de piste en ligne où les utilisateurs doivent résoudre des énigmes pour avancer.",
    link: "https://github.com/Fyoken/Site_jeu_de_Piste",
  },
  {
    title: "Prédiction visiteur Kubernetes Kafka",
    description: "Utilisation de Kubernetes et Kafka pour prévoir le trafic de visiteurs sur un site web.",
    link: "https://github.com/Fyoken/Prediction_visiteur_Kubernetes_Kafka",
  },
  {
    title: "Jeu Motus Microservices",
    description: "Développement du jeu Motus en utilisant une architecture microservices.",
    link: "https://github.com/Fyoken/Jeu_Motus_Microservices",
  },
  {
    title: "Reconnaissance faciale ACP Java",
    description: "Développement d'un système de reconnaissance faciale en utilisant l'Analyse en Composantes Principales (ACP) en Java.",
    link: "https://github.com/Fyoken/Reconnaissance_faciale_ACP_Java",
  },
  {
    title: "Site commerce JEE",
    description: "Site de commerce électronique développé en utilisant Java EE (JEE).",
    link: "https://github.com/Fyoken/Site_commerce_JEE",
  },

];

function Projects() {
  return (
    <section id="projects">
      <h2>Mes projets</h2>
      <div className="project-grid">
        {projectList.map((project, index) => (
          <div className="project-card" key={index}>
            <h3>{project.title}</h3>
            <p>{project.description}</p>
            <a href={project.link} target="_blank" rel="noopener noreferrer">Voir sur GitHub</a>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Projects;
